
<!doctype html>
<html lang="en">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>Roombr Projection Calculator</title>
<link href="https://fonts.googleapis.com/css2?family=Poppins:wght@400;600;700&display=swap" rel="stylesheet">
<script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js"></script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js"></script>
<style>
  :root{--teal-700:#0d8f87;--teal-500:#26b9b0;--teal-200:#a7e3de;}
  body{margin:0;font-family:'Poppins',sans-serif;background:linear-gradient(180deg,var(--teal-200) 0%, #ffffff 75%);display:flex;align-items:flex-start;justify-content:center;padding:28px;}
  .card{width:100%;max-width:1000px;background:#fff;border-radius:14px;box-shadow:0 10px 30px rgba(8,30,30,0.08);overflow:hidden;}
  .header{padding:18px 24px;background:linear-gradient(90deg,#f7fffe, #f2fffd);display:flex;align-items:center;gap:16px;border-bottom:1px solid #effdfa;}
  .title{color:var(--teal-700);font-weight:700;font-size:18px;}
  .logo{height:44px}
  .body{display:flex;gap:20px;padding:20px;flex-wrap:wrap;}
  .left{flex:1;min-width:320px} 
  .right{width:420px;min-width:320px;background:#fbfffe;border-radius:10px;padding:14px;border:1px solid #eef8f6}
  label{display:block;margin:8px 0 6px;color:#0b5b59;font-weight:600;font-size:13px;}
  input[type=number], select, input[type=text]{width:100%;padding:10px 12px;border-radius:8px;border:1px solid #e6f6f4;font-size:15px;}
  .row{display:flex;gap:10px;}
  .small{font-size:13px;color:#0b5b59}
  .btn{display:inline-block;padding:10px 14px;border-radius:8px;border:none;background:var(--teal-700);color:#fff;font-weight:600;cursor:pointer;margin-top:12px;}
  .btn.secondary{background:#0b7a75;margin-left:8px;}
  .results{display:grid;grid-template-columns:1fr;gap:10px;}
  .result-card{background:#fff;border:1px solid #e7f6f4;padding:12px;border-radius:10px;}
  .result-label{font-size:13px;color:#0b5b59;font-weight:700;}
  .result-value{font-size:18px;color:#023b3a;font-weight:700;margin-top:6px;}
  .diagram-wrap{background:#ffffff;padding:12px;border-radius:10px;border:1px solid #eaf6f4}
  .diagram{position:relative;height:260px;overflow:hidden;border-radius:8px;background:linear-gradient(180deg,#f9fffe,#ffffff);}
  .projector{position:absolute;left:18px;bottom:20px;width:34px;height:22px;background:#111827;border-radius:6px;box-shadow:0 4px 10px rgba(0,0,0,0.12);}
  .beam{position:absolute;left:18px;bottom:32px;height:120px;background:linear-gradient(90deg,rgba(253,224,71,0.12),rgba(253,224,71,0.06));border-radius:2px;transform-origin:left center;} 
  .screen-el{position:absolute;right:18px;bottom:18px;background:linear-gradient(90deg,#1e3a8a,#3b82f6);color:white;font-weight:700;display:flex;align-items:center;justify-content:center;border-radius:6px;padding:6px;}
  .footer{padding:12px 18px;text-align:center;color:#0b6767;font-weight:700;background:linear-gradient(90deg,#f7fffe,#f2fffd);border-top:1px solid #effdfa;}
  @media(max-width:880px){.body{flex-direction:column-reverse} .right{width:100%}}
</style>
</head>

<script>
(function(){
  const el = id => document.getElementById(id);
  function toInches(value, unit) { if(unit==='in') return value; if(unit==='cm') return value/2.54; if(unit==='m') return value*100/2.54; return value; }
  function fromInches(val, u) { if(u==='inches') return val; if(u==='feet') return val/12; if(u==='meters') return val*0.0254; return val; }

  function calculate() {
    const tr = parseFloat(el('throw').value) || 0;
    const diag = parseFloat(el('diagonal').value) || 0;
    const inUnit = el('inUnit').value;
    const outUnit = el('outUnit').value;
    const [aw, ah] = (el('aspect').value||'16:9').split(':').map(Number);
    if(!aw||!ah||!tr||!diag) { return; }

    const diagIn = toInches(diag, inUnit);
    const aspectDiag = Math.sqrt(aw*aw + ah*ah);
    const w_in = diagIn * (aw / aspectDiag);
    const h_in = diagIn * (ah / aspectDiag);
    const d_in = w_in * tr;

    const w_out = fromInches(w_in, outUnit);
    const h_out = fromInches(h_in, outUnit);
    const d_out = fromInches(d_in, outUnit);

    el('widthVal').textContent = w_out.toFixed(2) + ' ' + (outUnit==='inches'?'in':outUnit==='feet'?'ft':'m');
    el('heightVal').textContent = h_out.toFixed(2) + ' ' + (outUnit==='inches'?'in':outUnit==='feet'?'ft':'m');
    el('distanceVal').textContent = d_out.toFixed(2) + ' ' + (outUnit==='inches'?'in':outUnit==='feet'?'ft':'m');

    // diagram scaling
    const diagram = el('diagram');
    const projectorEl = el('projector');
    const beam = el('beam');
    const screenEl = el('screenEl');
    const meas = el('measText');

    const containerW = diagram.clientWidth;
    let scale = (containerW - 140) / Math.max(d_in, 1);
    if(scale > 2) scale = 2;
    if(scale < 0.04) scale = 0.04;

    const screenW_px = Math.max(40, w_in * scale);
    const screenH_px = Math.max(30, h_in * scale);
    const dist_px = Math.max(20, d_in * scale);

    beam.style.width = dist_px + 'px';
    beam.style.height = (screenH_px + 12) + 'px';
    screenEl.style.width = screenW_px + 'px';
    screenEl.style.height = screenH_px + 'px';

    meas.textContent = 'Distance â‰ˆ ' + d_out.toFixed(2) + ' ' + (outUnit==='inches'?'in':outUnit==='feet'?'ft':'m');
  }

  async function exportPDF() {
    const { jsPDF } = window.jspdf;
    const card = document.getElementById('card');
    const canvas = await html2canvas(card, {scale:2, useCORS:true});
    const img = canvas.toDataURL('image/png');
    const pdf = new jsPDF('p','mm','a4');
    const pdfWidth = pdf.internal.pageSize.getWidth();
    const pdfHeight = (canvas.height * pdfWidth) / canvas.width;
    pdf.addImage(img, 'PNG', 0, 0, pdfWidth, pdfHeight);
    pdf.save();
  }

  function reset() { document.getElementById('throw').value='0.8'; document.getElementById('aspect').value='16:9'; document.getElementById('diagonal').value='120'; document.getElementById('inUnit').value='in'; document.getElementById('outUnit').value='inches'; calculate(); }

  document.getElementById('calcBtn').addEventListener('click', calculate);
  document.getElementById('pdfBtn').addEventListener('click', exportPDF);
  document.querySelectorAll('input,select').forEach(i=>i.addEventListener('input', calculate));

  // defaults
  calculate();
})();
</script>
